import React from 'react';

const LandingPage = () => {
  return (
    <div className="bg-gradient-to-r from-blue-500 to-purple-500 min-h-screen text-white">
      <header className="flex justify-between items-center p-6">
        <h1 className="text-3xl font-bold">ProjectX</h1>
        <nav className="space-x-4">
          <a href="/login" className="bg-white text-blue-600 px-4 py-2 rounded">Login</a>
          <a href="/register" className="bg-blue-600 px-4 py-2 rounded">Sign Up</a>
        </nav>
      </header>
      <main className="flex flex-col justify-center items-center text-center mt-20">
        <h2 className="text-5xl font-extrabold mb-6">Empower Your Organization</h2>
        <p className="text-xl mb-6">
          Seamlessly manage workflows, tasks, and documentation.
        </p>
        <div className="space-x-4">
          <a href="/register" className="bg-white text-blue-600 px-6 py-3 rounded">Get Started</a>
          <a href="#features" className="bg-blue-600 px-6 py-3 rounded">Learn More</a>
        </div>
      </main>
    </div>
  );
};

export default LandingPage;
